import React from 'react'
import { useState } from 'react';
import axios from 'axios'

const BodyFatPercentage = () => {
    const[data,setData]=useState({
        age:'',
        gender:'',
        weight:'',
        height:'',
        neck:'',
        waist:'',
        hip:''
    })
    const options = {
        method: 'GET',
      
        params: {
        //   age:data.age,
        //   gender:data.gender,
        //   weight:data.weight,
        //   height:data.height,
        //   neck:data.neck,
        //   waist:data.waist,
        //   hip:data.hip
    age: '25',
    gender: 'male',
    weight: '70',
    height: '178',
    neck: '50',
    waist: '96',
    hip: '92'
        },
        headers: {
          'X-RapidAPI-Key': 'b3d275f402msh24baafd325292e0p12625ajsnc24a8e1a0737',
          'X-RapidAPI-Host': 'fitness-calculator.p.rapidapi.com'
        }
      };
    const res = axios.request(options).then(function (response) {
        console.log(response.data);
    }).catch(function (error) {
        console.error(error);
    });
  return (
    axios.request(options).then(function (response) {
        console.log(response.data);
    }).catch(function (error) {
        console.error(error);
    })
  )
}

export default BodyFatPercentage
